import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
    width: '100%',
    backgroundColor: 'brown',
  },
  buttonContainer: {
    display: 'flex',
    width: '100%',
  },
  button: {
    display: 'flex',
    width: '50%',
  },
});

export default styles;
